import React, { Component } from "react";
import axios from "axios";
import "../css/CoinStats.css";

export default class CoinData extends Component {
	componentDidMount() {
		axios
			.get("https://explorer.xwp.one/api/networkinfo")
			.then((response) => {
                this.setState({ hashrate: response.data.hash_rate });
				console.log(response.data);
			})
			.catch((error) => {
				console.log(error);
			});
	}
	render() {
        const { hashrate } = this.state;
		return (
			<div className="columns coinStats">
				<div class="column is-flex"></div>
                <div>{hashrate}</div>
				<div class="column is-2"></div>
				<div class="column is-2"></div>
				<div class="column is-flex"></div>
			</div>
		);
	}
}
